import React from "react";
import "./products.css";

const Products = () => {
  return (
    <div className="product-page container">
      <h3 className="product-title">Best Choices</h3>
      <h4 className="sub-title">Best Shoes</h4>
      
      <div className="product-carousel">
        {/* Scrolling left icon */}
        <div className="scroll-icon left">
          <i className="fas fa-chevron-left"></i>
        </div>
        
        {/* Scrollable cards */}
        <div className="product-cards">
          {/* Card 1 */}
          <div className="product-card">
            <img src="/images/shoe1.jpg" alt="Shoe 1" />
            <h5>Running Shoe</h5>
            <p>Comfortable and stylish for your runs.</p>
          </div>
          {/* Add more cards... */}
        </div>
        
        {/* Scrolling right icon */}
        <div className="scroll-icon right">
          <i className="fas fa-chevron-right"></i>
        </div>
      </div>
    </div>
  );
};

export default Products;
